import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      title: 'Frontend Development',
      icon: '🎨',
      skills: [
        { name: 'React.js', level: 90 },
        { name: 'JavaScript', level: 95 },
        { name: 'TypeScript', level: 85 },
        { name: 'HTML5/CSS3', level: 95 },
        { name: 'Tailwind CSS', level: 90 },
        { name: 'Next.js', level: 80 }
      ]
    },
    {
      title: 'Backend Development',
      icon: '⚙️',
      skills: [
        { name: 'Node.js', level: 85 },
        { name: 'Python', level: 80 },
        { name: 'Express.js', level: 85 },
        { name: 'MongoDB', level: 75 },
        { name: 'PostgreSQL', level: 70 },
        { name: 'REST APIs', level: 90 }
      ]
    },
    {
      title: 'Tools & Technologies',
      icon: '🛠️',
      skills: [
        { name: 'Git/GitHub', level: 90 },
        { name: 'Docker', level: 70 },
        { name: 'AWS', level: 65 },
        { name: 'Figma', level: 80 },
        { name: 'VS Code', level: 95 },
        { name: 'Linux', level: 75 }
      ]
    }
  ];

  return (
    <section id="skills" className="py-16 sm:py-20 lg:py-24 gradient-bg">
      <div className="container-max section-padding">
        <div className="max-w-7xl mx-auto">
          {/* Section Header */}
          <div className="text-center mb-16">
            <h2 className="text-3xl sm:text-4xl lg:text-5xl font-bold text-nature-white-900 mb-6">
              My <span className="text-gradient">Skills</span>
            </h2>
            <p className="text-lg text-nature-white-600 max-w-3xl mx-auto">
              Here are the technologies and tools I work with to bring ideas to life
            </p>
            <div className="w-24 h-1 bg-gradient-to-r from-nature-green-400 to-nature-green-600 mx-auto rounded-full mt-6"></div>
          </div>

          {/* Skills Grid */}
          <div className="grid lg:grid-cols-3 gap-8">
            {skillCategories.map((category, categoryIndex) => (
              <div key={categoryIndex} className="card">
                <div className="text-center mb-6">
                  <div className="text-4xl mb-4">{category.icon}</div>
                  <h3 className="text-xl font-bold text-nature-white-900 mb-2">{category.title}</h3>
                </div>
                
                <div className="space-y-4">
                  {category.skills.map((skill, skillIndex) => (
                    <div key={skillIndex} className="space-y-2">
                      <div className="flex justify-between items-center">
                        <span className="text-nature-white-700 font-medium">{skill.name}</span>
                        <span className="text-nature-green-600 font-semibold">{skill.level}%</span>
                      </div>
                      <div className="w-full bg-nature-green-100 rounded-full h-2">
                        <div 
                          className="bg-gradient-to-r from-nature-green-400 to-nature-green-600 h-2 rounded-full transition-all duration-1000 ease-out"
                          style={{ width: `${skill.level}%` }}
                        ></div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>

          {/* Additional Skills */}
          <div className="mt-16">
            <h3 className="text-2xl font-bold text-nature-white-900 text-center mb-8">
              Additional Skills
            </h3>
            <div className="flex flex-wrap justify-center gap-4">
              {[
                'Problem Solving', 'Team Leadership', 'Project Management', 
                'Agile/Scrum', 'Code Review', 'Mentoring', 'Technical Writing',
                'Performance Optimization', 'Security Best Practices', 'Cross-platform Development'
              ].map((skill, index) => (
                <div key={index} className="px-6 py-3 bg-white rounded-full shadow-md hover:shadow-lg transition-shadow duration-300 border border-nature-green-100">
                  <span className="text-nature-white-700 font-medium">{skill}</span>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
